import React from 'react';
import { Col, Container, Row, Image } from "react-bootstrap";

const DevicePage = () => {
    const device = { id: 1, name: "Iphone 12 pro", price: 25000, rating: 5, img: "https://www.purposechurch.com/wp-content/uploads/2017/10/fpo400x300.png" }
    return (
        <Container className='mt-3'>
            <Row>
                <Col md={4}>
                    <Image width={300} height={300} src={device.img} />
                </Col>
                <Col md={4}>
                    {/* Здесь может быть описание устройства */}
                </Col>
                <Col md={4}>
                    {/* Здесь может быть цена и кнопка "Купить" */}
                </Col>
            </Row>
        </Container>
    );
};

export default DevicePage;
